import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
const Expenseview=()=>{
const [expence,setExpense]=useState([])
const {eid}=useParams()
    useEffect(()=>{
        fetch(`/viewexpense/viewuser/${eid}`,{
            method:"get",
            headers: {
                "Content-Type": "application/json",
            },

        })
        .then((res)=>{
            setExpense(res)
        })
    },[])
    return(
        <div>
        <table>
            <tr>

                <th>Invoice Id:&nbsp; &nbsp; &nbsp;</th>
                <th>Date:&nbsp; &nbsp; &nbsp;</th>
                <th>Amount:&nbsp; &nbsp; &nbsp;</th>
                <th>Description:&nbsp; &nbsp; &nbsp;</th>
                <th>Status:&nbsp; &nbsp; &nbsp;</th>
            </tr>
            <tbody>

         <tr>

            <td>{expence.invoice_id}</td>
            <td>{expence.date}</td>
            <td>{expence.amount}</td>
            <td>{expence.desc}</td>
            <td>{expence.status}</td>




        </tr>


            </tbody>
        </table>
        </div>
    )
}

export default Expenseview
